extendedTextMessage.text:
Claro, aquí tienes un ejemplo de cómo imprimir "Hola, mundo" en C#:

```csharp
using System;

class Program
{
    static void Main()
    {
        Console.WriteLine("Hola, mundo");
    }
}
```

Con este código, al ejecutar el programa, verás que imprime "Hola, mundo" en la consola. ¡Es un buen punto de partida para comenzar a programar en C#!
